import  PropTypes from "prop-types"
import { Button } from "react-bootstrap"
const Button1 = ({label,link,type}) => {
  return ( 
    <Button
      style={{
        width: '150px',
        border: 'solid 3px',
        borderRadius: '10px',
        borderColor: 'black',
        color: 'black',
        backgroundColor: '#C4EBFF',
        marginLeft: '10px',
        
      }}
    >
      {label}
    </Button>
  )
}
Button1.defaultProps = {
    link: "home.html"
}
export default Button1
